import React from 'react';
import Divider from './Divider';

class Footer extends React.Component {
	render() {
		return (
			<footer className="container">
				<div className="row">
					<Divider/>
				</div>
				<div className="row">
					<p>Documentation</p>
					<p>Copyrights</p>
					<p>Contact</p>
				</div>
			</footer>
		)
	}
}

export default Footer;
